import { configure } from '@storybook/react';
import { addParameters } from '@storybook/react';
import mdx from '../src/components/button.stories.mdx';
import { DocsContainer } from '@storybook/addon-docs/blocks';


configure(require.context('../src/components', true, /\.stories\.js$/), require.context('../lib', true, /\.stories\.js$/), module);
addParameters({
    docs: {
      container: DocsContainer,
      page: mdx,
    },
  });
